  IGRIGG, Belinda Margaret and STENFERT KROESE, Johannes Arie (Joost)
  02> STENFERT KROESE, Nico Pieter
  b 24.11.1996
  Nico b. at Christchurch.
  02> GRIGG, Celia Phyllis m on 03.12.1982 to SOWMAN, Lindsay John
  b 22.10.1962
  b 26.11.1956
  Celia b. at Cheviot. Surname, Grigg. Lindsay b. at Blenheim. Address: PO Box 33268, Christchurch.
  Celia was educated at St Margaret's College and Canterbury University (BA in Education). She is a
  feminist involved in childbirth politics. She won a Churchill Fellowship in 1990 to study the
  systems of childbirth in The Netherlands, Sweden and Denmark. Celia retrained to be a midwife at
  Otago Polytechnic, graduating Bachelor of Midwifery in 1992. She practices as an independent
  midwife with Midwifery Associates in Christchurch, and is an active member of the New Zealand
  College of Midwives. Her interests include reading, sewing, swimming, bush/beach walking, dancing
  and vegetable gardening.
  Lindsay was educated in Blenheim. He moved to Christchurch and completed an MA in Psychology (1st
  Class Hons) in 1980 and then went on to practise psychotherapy and counselling for over seven
  years. He returned to University in 1990 to retrain as a landscape architect, graduating BLA(Hons).
  He works in private practice and teaches at Lincoln University.
  01> SOWMAN, Francesca Nola
  b 06.10.1984
  Francesca b, at Christchurch. She was educated at Beckenham Primary School where she was Dux
  in 1997, and is now at Avonside Girls' High School. Her interests include cricket, creative
  writing, piano, fencing, swimming and languages.
  GRIGG, Breanna Chloe
  b 28.11.1987
  Breanna b. at Christchurch. She is a student at Beckenham Primary School and her interests
  include piano and flute, swimming, art and creative design, bush walking and geology.
  03> GRIGG, Peter Gilbert m on 11.01.1992 to O'CONNOR, Elizabeth Jane
  Kenneth
  b 28.05.1965
  b 04.10.1963
  Peter b. at Cheviot and m, at St Anthony's Church, Cheviot. Elizabeth, d/o Kevin Joseph O'Connor
  and Elsie Mary Gallagher, b. at Timaru, Address: "Bodbrane", RD 3, Cheviot, North Canterbury.
  Peter was educated at Waihi Preparatory School, Christ's College and Lincoln College (DipAg).
  Whilst in primary school he represented South Canterbury at hockey and he captained the Christ's
  College 1st hockey XI in 1981-82. After an extensive overseas trip, he took over "Bodbrane" in
  1990. He is president of the local cricket club and interested in ball games, golf, fishing and
  travelling.
  Elizabeth attended Teachers' Training College in Christchurch to become a primary school teacher.
  She plays clarinet and piano.
  01> GRIGG, Ella Victoria
  b 21.02.1995
  Ella b, at Rangiora.
